#INSERT INTO `NEWS_VARIANTS_EXT` VALUES (11,1,NULL,'ru',NULL,'<p><strong>Exrates &ndash; </strong><strong> - , </strong>             .</p>\n<p>           .</p>\n<p>      Exrates            .</p>\n<p>,     !</p>\n<p><strong> :</strong>&nbsp;</p>\n<p><strong>-  :</strong></p>\n<p>        ;</p>\n<p><strong>-  :</strong></p>\n<p>       ,      ,   ,     ( ),</p>\n<p> / ,   ,      .</p>\n<p><strong>-  :</strong></p>\n<p>         ,     ,       .</p>\n<p> ,    ,          .</p>\n<p><strong>- Bitcoin, , EDR, EDRCoin USD, EUR, RUB:</strong></p>\n<p>       ,  Bitcoin,   ,  .</p>\n<p>             .</p>\n<p>    / <strong>USD, EUR, RUR, IDR, UAH</strong>       ;</p>\n<p><strong>-    :</strong></p>\n<p>    ,   ,      ;</p>\n<p><strong>-  :</strong></p>\n<p><em><u>    ,     </u></em></p>\n<p><em><u>     ,    .</u></em></p>\n<p><strong>-      ,    :</strong></p>\n<p>         .</p>\n<p><strong>   !</strong></p>','2017-02-14 14:43:37','',0,NULL,NULL,'2017-02-14 14:45:36'),(12,1,NULL,'in',NULL,'<p><strong>Exrates</strong> - secara aktif tumbuh Platform, prioritas yang adalah untuk menciptakan kondisi yang nyaman dan praktis untuk penggunaan pengguna Exchange.</p>\n<p>Kami menghargai waktu Anda dan menawarkan beberapa pilihan untuk umpan balik segera.<br />Ahli yang kompeten chat online dukungan Exrates pertukaran cepat membantu memecahkan setiap pertanyaan Anda.<br />Setiap hari, akhir pekan dan hari libur!</p>\n<p><strong>Keunggulan kami:</strong></p>\n<p><strong>- Komisi Minimum:</strong><br />Bursa mengambil komisi minimum untuk input dan output berarti;</p>\n<p><strong>- Keamanan maksimum:</strong><br />Ketika mengembangkan proyek diperhitungkan semua kemungkinan kesalahan yang bisa membahayakan keamanan keamanan data, informasi pengguna, akses akun pengguna (password keuangan), masukan keselamatan dan output, dan salah satu utama, penyimpanan yang aman dari semua mata uang.</p>\n<p><strong>- Kemudahan penggunaan:</strong><br />Kegunaan telah dikembangkan dan dioptimalkan oleh sistem berpengalaman pengguna pertukaran, dan asisten pihak ketiga, yang tidak menggunakan pertukaran jasa.</p>\n<p><br /><strong>- Bitcoin, EDR, EDRCoin, USD, EUR, RUB:</strong><br />Exchange menyediakan kemampuan untuk bertukar tidak hanya dari kelas berat seperti Bitcoin, tapi menjanjikan, cryptocurrency saat ini.<br />Daftar mata uang alternatif akan diperluas dan Anda dapat membantu kami untuk mengidentifikasi prioritas mereka.<br />Exchange juga menyediakan kemampuan untuk input output USD, EUR, RUR, IDR, UAH dan pertukaran mereka untuk cryptocurrency antara pengguna;</p>\n<p><strong>- Penjabaran antara pengguna:</strong><br />Mengetahui julukan pengguna dalam sistem, melalui bursa saham, Anda dapat mengirim dia mata uang apapun;</p>\n<p><strong>- Exchange-traded instrumen:</strong><br />bermain kami cocok bagi pemula yang ingin menukarkan uang mereka<br />dengan pengguna lain pada tingkat pasar, dan pedagang berpengalaman.</p>\n<p><strong>- Pengembangan berkelanjutan dan umpan balik, untuk memperhitungkan kebutuhan mereka:</strong><br />Kami tidak berniat untuk beristirahat pada fungsi capai kami dari layanan kami.</p>\n<p><strong>Kami berharap Anda penawaran yang baik!</strong></p>','2017-02-14 14:50:06','',NULL,NULL,NULL,'2017-02-14 14:50:06'),(13,1,NULL,'cn',NULL,'<p>Exrates -  - </p>\n<p>Exrates<br /></p>\n<p></p>\n<p>- <br />&nbsp;;</p>\n<p>- <br /></p>\n<p>- <br /> - </p>\n<p>- Bitcoin, EDR, EDRCoin USD, EUR, RUB:<br />ExchangeBitcoincryptocurrency<br /><br /> USD, EUR, RUR, IDR, UAH cryptocurrency;</p>\n<p>- <br />;</p>\n<p>- <br /> </p>\n<p>- <br /></p>\n<p></p>','2017-02-14 15:40:31','',NULL,NULL,NULL,'2017-02-14 15:40:31'),(14,1,NULL,'en',NULL,'<p><strong>Exrates</strong> is an actively-growing platform. Creating comfortable and practical conditions for using the Exchange is our priority.</p>\n<p><strong>This is</strong></p>\n<ul>\n<li><strong><u>Minimum commission:</u></strong></li>\n</ul>\n<p>The Exchange takes a minimum commission for input and out